VALUES ('3760181251086', 'Agar agar', 'Agar agar Gélifiant Usage alimentaire (E406) Gélifiant issu d\'algues rouges, l\'agar agar est un bon substitut de la gélatine animale et des pectines. L\'agar est un gélifiant exempt de lipides et riche en fibre. Recettes : gelées, mousses chaudes, aspics, confitures allégées... A utiliser exclusivement dilué dans le cadre d\'une préparation alimentaire. Ne pas laisser à la portée des en - fants. Ne pas utiliser dans les pro - duits de gelée en mini-barquettes ou mini-capsules. Conserver à l\'abri de la chaleur et de l\'humidité. Poudre conditionnée dans un atelier utilisant : blé, soja, sulfites, glu - ten, lactose.', 'https://static.openfoodfacts.org/images/products/376/018/125/1086/front_fr.4.400.jpg', '0', '0', '86.4', '0.4', '86', '0.1', '0.52', '0.204724409448819', '', '1');

